  02>'CANNING, Elsie Mary McQueen m on 02.08.1929 to WYNNE - LEWIS, Thomas Herbert
  (Nunie)
  (Toc)
  b 31.07.1898 d 17.11.1987
  b 18.06.1897 d 09.06.1992
  Thomas b. in England.
  After being commissioned in the Lancashire Fusiliers in Flanders, he volunteered to fly and served in
  34 Squadron RFC during WW1. He survived multiple wounds from machinegun-fire and a crash landing
  towards the end of the war. He was a founding director of Consolidated Press in Sydney with FH
  Packer, was on the Mascot Airport Committee when Kingsford Smith made his famous inaugural flight to
  New Zealand in the "Southern Cross", an was Principal of T H Wynne-Lewis and Sons, Chartered
  Accountants, based at 14 Martin Place. He was a director of a number of Australian companies, and was
  the longest serving member of the Royal Sydney Golf Club when he died at age 94.
  Nunie served for a time on the Waitangi Trust Board and had a life-long interest in the involvement of
  the Williams and Busby families in the early history of New Zealand. She came from an era when much of
  this early history was remembered and had been passed on to her by her mother and other older members
  of the family. She became an authority on matters relating to the family. Until recently Nunie and Toc
  lived in the Bay of Islands on the site of the original Henry Williams house on the Paihia beachfront.
  The original iron fireplace from Henry's house was used by Nunie as a flower pot stand (it is now used
  for the same purpose in the Wellington garden of her son, John).
  01> WYNNE-LEWIS, David Canning m on 11.02.1958 to TODD, Shirley Anne
  b 01.01.1932
  b 11.12.1936
  David b, at Sydney and m. at Waipukurau. Shirley, d/o Eric Todd and Joan Hobson. Address:
  "Ngahere", RD 4, Waipukurau.
  David was educated at Hereworth School and Wanganui Collegiate School and is farming at Porangahau,
  Shirley was educated at Nga Tawa and Otago University (DipPE, 1957). Both David and Shirley are
  active in community and church affairs, Shirley being a lay reader. David's particular interest is
  tennis.
  01> WYNNE - LEWIS, Peter Thomas m on 19.10. 1984 to MORRISSEY, Joanne
  b 16.02.1959
  b 21.11.1960
  Address: "Braeburn" Farm, RD 3, Porangahau.
  Peter graduated BAgCom from Lincoln University and is a farmer. Jo is a primary school teacher.
  01> WYNNE -LEWIS, Gemma Kate
  b 03.07.1991
  02> WYNNE - LEWIS, Robyn Joan
  b 20.05.1960
  Address: 212 Queen Street East, Hastings.
  Robyn graduated BPhysEd from Otago University and subsequently trained as a health promoter and
  Hellerwork practitioner (body/mind education). She has a private practice in Hastings.
  03> WYNNE -LEWIS, Susan m on 13.03.1987 to ROBINSON, Donald Guy Thomas
  b 30.07.1961
  b 11.09.1960 d 24.10.1992
  Susan m. at St Michael and All Angels Church, Porangahau. Donald, s/o Thomas Peele Robinson
  and Margaret Anne Brewer. Address: 9a Brodie Street, Riccarton, Christchurch 4.
  Susan has worked in nursing and in real estate. Donald farmed deer and cattle at Takapau. He
  was a skilled woodworker.
